import { useNavigate } from "react-router-dom";
import { signOut } from "firebase/auth";
import { auth } from "../firebase";

function Navbar() {
  const navigate = useNavigate();

  const logout = async () => {
    await signOut(auth);
    navigate("/");
  };

  return (
    <div style={styles.navbar}>
      {/* LEFT */}
      <div style={styles.logo} onClick={() => navigate("/home")}>
        AI Health Assistant
      </div>

      {/* CENTER */}
      <div style={styles.center}>
        <NavBtn label="Home" onClick={() => navigate("/home")} />
        <NavBtn label="Health Chat" onClick={() => navigate("/health-chat")} />
        <NavBtn label="Nearby Finder" onClick={() => navigate("/nearby")} />
        <NavBtn label="Map" onClick={() => navigate("/map")} />
        <NavBtn
          label="Emergency"
          danger
          onClick={() => navigate("/emergency")}
        />
      </div>

      {/* RIGHT */}
      <div style={styles.right}>
        <button style={styles.langBtn}>üåê EN</button>
        <button
          style={styles.feedbackBtn}
          onClick={() => navigate("/feedback")}
        >
          Feedback / Appointment
        </button>
        <button style={styles.profileBtn} onClick={logout}>
          Profile / Logout
        </button>
      </div>
    </div>
  );
}

function NavBtn({ label, onClick, danger }) {
  return (
    <button
      onClick={onClick}
      style={{
        ...styles.navBtn,
        ...(danger ? styles.dangerBtn : {}),
      }}
    >
      {label}
    </button>
  );
}

const styles = {
  navbar: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "12px 20px",
    backgroundColor: "#ffffff",
    borderBottom: "1px solid #e5e7eb",
    position: "sticky",
    top: 0,
    zIndex: 1000,
  },
  logo: {
    fontSize: "18px",
    fontWeight: "bold",
    cursor: "pointer",
  },
  center: {
    display: "flex",
    gap: "12px",
  },
  navBtn: {
    padding: "8px 14px",
    borderRadius: "6px",
    border: "none",
    backgroundColor: "#2563eb",
    color: "#fff",
    cursor: "pointer",
    fontSize: "14px",
  },
  dangerBtn: {
    backgroundColor: "#dc2626",
  },
  right: {
    display: "flex",
    gap: "10px",
  },
  langBtn: {
    padding: "8px 10px",
    borderRadius: "6px",
    border: "1px solid #ccc",
    background: "#f9fafb",
    cursor: "pointer",
  },
  feedbackBtn: {
    padding: "8px 12px",
    borderRadius: "6px",
    border: "none",
    backgroundColor: "#16a34a",
    color: "#fff",
    cursor: "pointer",
  },
  profileBtn: {
    padding: "8px 12px",
    borderRadius: "6px",
    border: "none",
    backgroundColor: "#374151",
    color: "#fff",
    cursor: "pointer",
  },
};

export default Navbar;
